const getVideoInfo = () => {
  console.log("response");
  <iframe
    width="560"
    height="315"
    src="https://www.youtube.com/embed/AsgDfoLF3WU"
    frameborder="0"
    allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
    allowfullscreen
  ></iframe>;
};

const Media = () => (
  <div>
    <h1>Youtube Code goes here</h1>
    {getVideoInfo()}
  </div>
);

export default Media;
